import React from 'react';

// Either Enable Mistakes Mode or Fast Mode
export function Mode(props) {
  return (
    <div className={ props.mode === 'mistakes' ? "prevent_mistake_section" : "fast_section"}>
      <label className={ props.mode === 'mistakes'
                          ? "prevent_mistake_section-switch"
                          : "fast_section-switch"}>
        <input type="checkbox" />
        <span className={ props.mode === 'mistakes'
                            ? "prevent_mistake_section-slider"
                            : "fast_section-slider"}
              onClick={props.onClickMode}
        ></span>
      </label>
      <p className="status__action-text">{ props.mode === 'mistakes'
                  ? 'Prevent Mistakes'
                  : 'Fast Mode'}</p>
    </div>
  )
}
